require('dotenv').config();
const mongoose = require('mongoose');
const Category = require('../src/models/category');
const logger = require('../src/config/logger');

// Placeholder base64 images for categories (replace with actual base64 strings in production)
const agricultureFoodImage = 'data:image/jpeg;base64,';

// Category data structure with images for categories and descriptions for both
const categoriesData = [
  {
    name: 'Agriculture and Food Industry',
    image: agricultureFoodImage,
    description: 'Products and equipment related to agriculture and food production',
    subcategories: [
      { name: 'Agricultural Equipment', description: 'Machinery and tools for farming' },
      { name: 'Food Grains', description: 'Cereals, pulses, and other grains' },
      { name: 'Dairy Products', description: 'Milk, cheese, and other dairy items' },
      { name: 'Processed Foods', description: 'Canned, frozen, and packaged foods' },
    ],
  },
];

const seedCategories = async () => {
  try {
    if (!process.env.MONGO_URI) {
      throw new Error('MONGO_URI is not defined in .env');
    }
    await mongoose.connect(process.env.MONGO_URI, {
      useNewUrlParser: true,
      useUnifiedTopology: true,
      serverSelectionTimeoutMS: 10000,
      heartbeatFrequencyMS: 10000,
    });
    logger.info('Connected to MongoDB for seeding');

    await Category.deleteMany();
    logger.info('Cleared existing categories');

    for (const [index, categoryData] of categoriesData.entries()) {
      const categoryDoc = new Category({
        name: categoryData.name,
        image: categoryData.image,
        description: categoryData.description || '',
      });
      await categoryDoc.save();
      logger.info('Seeded parent category', { index, name: categoryData.name, id: categoryDoc._id });

      if (categoryData.subcategories && categoryData.subcategories.length > 0) {
        for (const sub of categoryData.subcategories) {
          const subCategoryDoc = new Category({
            name: sub.name,
            parentId: categoryDoc._id,
            description: sub.description || '',
          });
          await subCategoryDoc.save();
          logger.info('Seeded subcategory', { name: sub.name, parentId: categoryDoc._id, id: subCategoryDoc._id });
        }
      }
    }

    logger.info('Categories seeding completed successfully', { totalCategories: categoriesData.length });
    await mongoose.connection.close();
    process.exit(0);
  } catch (error) {
    logger.error('Seeding error:', { error: error.message, stack: error.stack });
    console.error('Seeding failed:', error.message, error.stack);
    await mongoose.connection.close();
    process.exit(1);
  }
};

seedCategories();